import React, { useState, useEffect } from "react";
import {
  Users,
  BarChart3,
  Settings,
  List,
  Search,
  Loader2,
} from "lucide-react"; // icons

export default function AdminDashboard() {
  const [activeTab, setActiveTab] = useState("overview");

  // Users state
  const [users, setUsers] = useState([]);
  const [userSearch, setUserSearch] = useState("");
  const [userRole, setUserRole] = useState("all");
  const [userStatus, setUserStatus] = useState("all");
  const [userPage, setUserPage] = useState(1);
  const [loadingUsers, setLoadingUsers] = useState(true);

  // Logs state
  const [logs, setLogs] = useState([]);
  const [logPage, setLogPage] = useState(1);
  const [loadingLogs, setLoadingLogs] = useState(true);

  // Mock: simulate fetch
  useEffect(() => {
    setLoadingUsers(true);
    setTimeout(() => {
      setUsers([
        { id: 1, name: "Alice", role: "admin", status: "active" },
        { id: 2, name: "Bob", role: "user", status: "suspended" },
        { id: 3, name: "Charlie", role: "user", status: "active" },
      ]);
      setLoadingUsers(false);
    }, 800);
  }, [userPage]);

  useEffect(() => {
    setLoadingLogs(true);
    setTimeout(() => {
      setLogs([
        { id: 1, action: "User login", date: "2025-08-01" },
        { id: 2, action: "File uploaded", date: "2025-08-02" },
      ]);
      setLoadingLogs(false);
    }, 800);
  }, [logPage]);

  // Filtered users
  const filteredUsers = users.filter((u) => {
    const matchesSearch = u.name
      .toLowerCase()
      .includes(userSearch.toLowerCase());
    const matchesRole = userRole === "all" || u.role === userRole;
    const matchesStatus = userStatus === "all" || u.status === userStatus;
    return matchesSearch && matchesRole && matchesStatus;
  });

  return (
    <div className="p-6">
      {/* Tabs */}
      <div className="flex space-x-4 border-b pb-2 mb-6">
        <button
          onClick={() => setActiveTab("overview")}
          className={`flex items-center space-x-2 px-3 py-2 rounded-t-lg ${
            activeTab === "overview" ? "bg-blue-600 text-white" : "text-gray-600"
          }`}
        >
          <BarChart3 size={18} />
          <span>Overview</span>
        </button>
        <button
          onClick={() => setActiveTab("users")}
          className={`flex items-center space-x-2 px-3 py-2 rounded-t-lg ${
            activeTab === "users" ? "bg-blue-600 text-white" : "text-gray-600"
          }`}
        >
          <Users size={18} />
          <span>Users</span>
        </button>
        <button
          onClick={() => setActiveTab("logs")}
          className={`flex items-center space-x-2 px-3 py-2 rounded-t-lg ${
            activeTab === "logs" ? "bg-blue-600 text-white" : "text-gray-600"
          }`}
        >
          <List size={18} />
          <span>Logs</span>
        </button>
        <button
          onClick={() => setActiveTab("settings")}
          className={`flex items-center space-x-2 px-3 py-2 rounded-t-lg ${
            activeTab === "settings"
              ? "bg-blue-600 text-white"
              : "text-gray-600"
          }`}
        >
          <Settings size={18} />
          <span>Settings</span>
        </button>
      </div>

      {/* Overview */}
      {activeTab === "overview" && (
        <div>
          <h2 className="text-xl font-semibold mb-4">Quick Stats</h2>
          <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
            <div className="p-4 bg-white rounded-lg shadow">Users: 120</div>
            <div className="p-4 bg-white rounded-lg shadow">Logs: 540</div>
            <div className="p-4 bg-white rounded-lg shadow">Uploads: 89</div>
            <div className="p-4 bg-white rounded-lg shadow">Errors: 3</div>
          </div>
        </div>
      )}

      {/* Users */}
      {activeTab === "users" && (
        <div>
          <h2 className="text-xl font-semibold mb-4">Manage Users</h2>

          {/* Search + Filters */}
          <div className="flex items-center space-x-3 mb-4">
            <div className="flex items-center border rounded-lg px-2 py-1">
              <Search size={16} className="text-gray-500" />
              <input
                type="text"
                placeholder="Search users..."
                value={userSearch}
                onChange={(e) => setUserSearch(e.target.value)}
                className="ml-2 outline-none"
              />
            </div>
            <select
              value={userRole}
              onChange={(e) => setUserRole(e.target.value)}
              className="border px-2 py-1 rounded"
            >
              <option value="all">All Roles</option>
              <option value="admin">Admin</option>
              <option value="user">User</option>
            </select>
            <select
              value={userStatus}
              onChange={(e) => setUserStatus(e.target.value)}
              className="border px-2 py-1 rounded"
            >
              <option value="all">All Status</option>
              <option value="active">Active</option>
              <option value="suspended">Suspended</option>
            </select>
          </div>

          {/* Table */}
          {loadingUsers ? (
            <div className="flex items-center space-x-2">
              <Loader2 className="animate-spin" size={20} />
              <span>Loading users...</span>
            </div>
          ) : filteredUsers.length === 0 ? (
            <p className="text-gray-500">No users found.</p>
          ) : (
            <table className="w-full border">
              <thead className="bg-gray-100">
                <tr>
                  <th className="p-2 text-left">Name</th>
                  <th className="p-2">Role</th>
                  <th className="p-2">Status</th>
                </tr>
              </thead>
              <tbody>
                {filteredUsers.map((user) => (
                  <tr key={user.id} className="border-t">
                    <td className="p-2">{user.name}</td>
                    <td className="p-2">{user.role}</td>
                    <td className="p-2">{user.status}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}

          {/* Pagination */}
          <div className="flex justify-between mt-3">
            <button
              onClick={() => setUserPage((p) => Math.max(p - 1, 1))}
              className="px-3 py-1 bg-gray-200 rounded"
            >
              Prev
            </button>
            <span>Page {userPage}</span>
            <button
              onClick={() => setUserPage((p) => p + 1)}
              className="px-3 py-1 bg-gray-200 rounded"
            >
              Next
            </button>
          </div>
        </div>
      )}

      {/* Logs */}
      {activeTab === "logs" && (
        <div>
          <h2 className="text-xl font-semibold mb-4">System Logs</h2>
          {loadingLogs ? (
            <div className="flex items-center space-x-2">
              <Loader2 className="animate-spin" size={20} />
              <span>Loading logs...</span>
            </div>
          ) : logs.length === 0 ? (
            <p className="text-gray-500">No logs available.</p>
          ) : (
            <ul className="space-y-2">
              {logs.map((log) => (
                <li
                  key={log.id}
                  className="p-3 bg-white rounded-lg shadow flex justify-between"
                >
                  <span>{log.action}</span>
                  <span className="text-gray-500 text-sm">{log.date}</span>
                </li>
              ))}
            </ul>
          )}

          {/* Pagination */}
          <div className="flex justify-between mt-3">
            <button
              onClick={() => setLogPage((p) => Math.max(p - 1, 1))}
              className="px-3 py-1 bg-gray-200 rounded"
            >
              Prev
            </button>
            <span>Page {logPage}</span>
            <button
              onClick={() => setLogPage((p) => p + 1)}
              className="px-3 py-1 bg-gray-200 rounded"
            >
              Next
            </button>
          </div>
        </div>
      )}

      {/* Settings */}
      {activeTab === "settings" && (
        <div>
          <h2 className="text-xl font-semibold mb-4">Admin Settings</h2>
          <p className="text-gray-600">Control system configurations here.</p>
        </div>
      )}
    </div>
  );
}
